import React from "react";
import ReactDOM from "react-dom/client";

import App from "./App";

let counter = 1;

let root = ReactDOM.createRoot(document.getElementById("root"));

const refresh = () => {
  root.render(<App counter={counter} />);
};

setInterval(() => {
  refresh();
  counter += 1;
}, 1000);
